import Header from "../components/Header";

function Augustiner() {
  return(
    <div>
            <Header />
      
      <Container className="mt-4">
        <Row>
          <Col>
          {/* Form here */}
            <Forms />
          </Col>
          <Col>
          {/* Timer here */}
            <Timer text="Augustiner" />
          </Col>
        </Row>

        <Row className="mt-5">
          {/* Table */}
          <Tables />
        </Row>
      </Container>
    </div>
  )
};

export default Augustiner;
